INSERT INTO `blog_post` VALUES (1,'Honda CBR 650F or Kawasaki Z800','Autocar India','http://i.haymarketindia.net/Features/DSC_2086.jpg','Looking to upgrade from my Kawasaki Ninja 650.','/blog/post/1'),(2,'Updated Mercedes S-class to get 48V mild hybrid tech','Autocar India','http://i.haymarketindia.net/ExtraImages/20160614104131_sclass.jpg','The new 48V mild hybrid system will be seen across all Mercedes models in the future.','/blog/post/2'),(3,'Leaking turbocharger on 2010 Maruti Dzire','Autocar India','http://i.haymarketindia.net/Features/_MG_0219.jpg','The turbocharger is leaking and requires a total replacement. Could it be a manufacturing defect and can I claim cost from the company?','/blog/post/3'),(4,'2016 Kawasaki Ninja ZX-10R review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20160527124654_8.jpg','Kawasaki has pulled out all the stops with the updates on the 2016 ZX-10R. It\'s time to get under its skin and find out.','/blog/post/4'),(5,'New Audi R8 V10 Plus review, test drive','Autocar India','http://i.haymarketindia.net/ExtraImages/20160608010501_R8x2.jpg','Is the new supercar a step up from the impressive last-gen R8 V10 Plus?','/blog/post/5'),(6,'Armour for your car ','Autocar India','http://i.haymarketindia.net/Features/13.jpg','Wrapping your car in ballistic steel can protect you from AK47s and hand grenades. Doug Revolta finds out how itâ€™s done.','/blog/post/6'),(7,'New TVS Victor review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20160120122417_1.jpg','TVS has renewed its 110cc segment attack. Can the upgraded Victor hold its head high in this hotly contested space?','/blog/post/7'),(8,'New BMW 730Ld India review, test drive','Autocar India','http://i.haymarketindia.net/ExtraImages/20160506044953_fronttrack.jpg','Bavariaâ€™s new oil-burning flagship, like its petrol counterpart, is a technological marvel and a hoot to drive.','/blog/post/8'),(9,'TVS Jupiter MillionR launched at Rs 53,034','Autocar India','http://i.haymarketindia.net/ExtraImages/20160609040630_TVS Jupiter.png','The special-edition scooter has been launched to mark the sale of one million units of the TVS Jupiter; gets front disc brake.','/blog/post/9'),(10,'BMW X5M, X6M track drive','Autocar India','http://i.haymarketindia.net/Features/b4.jpg','The X5M and X6M are designed to be fast SUVs that provide a user-friendly experience. We find out how they perform on the track.','/blog/post/10'),(11,'First Indian Desmo Owners Club ride held in Mumbai','Autocar India','http://i.haymarketindia.net/ExtraImages/20160606060019_ducati.jpg','The Mumbai D.O.C rode from Ducati\'s dealership in Bandra to Lower Parel via Nariman Point; D.O.Cs to roll out in Pune, Delhi and Bengaluru next.','/blog/post/11'),(12,'Maruti Baleno long term review, first report','Autocar India','http://i.haymarketindia.net/ExtraImages/20160311105437_3.jpg','Marutiâ€™s big hatchback ticks all the right boxes for a good city car. But, how good is it to live with on a day-to-day basis?','/blog/post/12'),(13,'Mobil 1 Great car great road: BMW i8','Autocar India','http://i.haymarketindia.net/Features/20150630052756__DSC4476.jpg','Sponsored feature: A quick blast through Rajasthan shows that the BMW i8 is as much about the past as it is about the future.','/blog/post/13'),(14,'A good diesel mid-sized sedan','Autocar India','http://i.haymarketindia.net/Features/_PFD2273.jpg','I canâ€™t decide between the Maruti Suzuki Ciaz and Honda City.','/blog/post/14'),(15,'Suzuki Burgman 650 Executive, review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20150908055402_1x.jpg','We take Suzukiâ€™s maxi-scooter out for a quick spin to see how well it fares on Indian roads.','/blog/post/15'),(16,'Datsun Redigo prices to start at Rs 2.39 lakh','Autocar India','http://i.haymarketindia.net/ExtraImages/20160602050102_Datsun-redi-GO-red.jpg','The starting price for the entry-level Redigo has been leaked on Datsun India\'s website, prior to its official launch on June 7, 2016.','/blog/post/16'),(17,'Sponsored feature:  OWNING THE BEST. MADE EASY','Autocar India','http://i.haymarketindia.net/Features/m2.jpg','SPONSORED FEATURE: We tell you how easy it is to own a Mercedes-Benz','/blog/post/17'),(18,'Bajaj Platina ES review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20150320015138_pl1.jpg','We get astride the Bajaj Platina ES, to find out if it lives up to its working class commuter claim.','/blog/post/18'),(19,'A good automatic sedan in Rs 15-20 lakh segment','Autocar India','http://i.haymarketindia.net/Features/sk.jpg','Looking to replace my current Toyota Corolla Altis.','/blog/post/19'),(20,'Catching the fastest man in the world - Andy Green','Autocar India','http://i.haymarketindia.net/Features/blood2.jpg','What goes into making a land speed record-breaking vehicle and how would it be to drive? We get the answers from Mr Supersonic himself.','/blog/post/20'),(21,'Hyundai i20 1.0 Kappa review, test drive','Autocar India','http://i.haymarketindia.net/ExtraImages/20160211012656_i20-hatch-117.jpg','Hyundai is mulling the introduction of an all-new 1.0-litre petrol engine in its i20 hatchback. Here\'s what it feels like from behind the wheel.','/blog/post/21'),(22,'New cars for 2016: Sedans','Autocar India','http://i.haymarketindia.net/ExtraImages/20160601035601_new_sedans.jpg','Here is a look at new sedans arriving in India over the course of the year.','/blog/post/22'),(23,'Sponsored Feature: A-Class Pulse Changers','Autocar India','http://i.haymarketindia.net/Features/SPONSOREDMAIN.jpg','Mercedes A-Class stands for the new generation of achievers who strive for success in lifestyle and business. We celebrate their passion for','/blog/post/23'),(24,'2016 Ford EcoSport review, test drive','Autocar India','http://i.haymarketindia.net/ExtraImages/20151126055040_Eco1.jpg','We drive the 2016 Ford EcoSport that gets a slight bump in power along with some other changes. Here\'s what we thought about it.','/blog/post/24'),(25,'Changing brake pads of 2013 Maruti Swift','Autocar India','http://i.haymarketindia.net/Features/20150518103356_swift.jpg','When is the ideal time to change the brake pads?','/blog/post/25'),(26,'Time travel: Heritage Transport Museum','Autocar India','http://i.haymarketindia.net/Features/mus3.jpg','The Heritage Transport Museum in Haryana is the first of its kind in India and offers a unique experience. Take a tour with Nikhil Bhatia.','/blog/post/26'),(27,'Triumph Thunderbird LT review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20141022060404_tri1.jpg','We take a ride to see what the Triumph\'s Harley challenger, the Thunderbird LT, is like.','/blog/post/27'),(28,'Diesel unlikely for next-gen Toyota Corolla','Autocar India','http://i.haymarketindia.net/ExtraImages/20160525010602_toyota.jpg','Option of diesel likely to be dropped for the new Corolla, due to decline in popularity of diesels and high costs for developing an all-new engine.','/blog/post/28'),(29,'Mercedes Benz E 250 CDI vs BMW 520d comparison','Autocar India','http://i.haymarketindia.net/Features/20140306090648_comparo1.jpg','How does BMW\'s refreshed 5-series match up to the facelifted Mercedes-Benz E-class?','/blog/post/29'),(30,'Polo vs Scala','Autocar India','http://i.haymarketindia.net/Features/20150127051735_Polo.jpg','Between the VW Polo GT TSI and Renault Scala RxL CVT, which one has low maintenance cost, is reliable and delivers good performance?','/blog/post/30'),(31,'Triumph Street Triple review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20140430075941_triumph1.jpg','We ride Triumphâ€™s famous Street Triple on Indian roads and come away mighty impressed.','/blog/post/31'),(32,'Maruti Celerio diesel long term review, first report','Autocar India','http://i.haymarketindia.net/ExtraImages/20150921033015_PFD_1625.jpg','It may not be the most exciting, but this Maruti is a practical and frugal urban runabout.','/blog/post/32'),(33,'New Mercedes E 63 AMG vs BMW M5','Autocar India','http://i.haymarketindia.net/Features/em1.jpg','The slightly unhinged Mercedes E 63 AMG takes on the the positively nuts BMW M5 on the mountain roads, highways, city streets and tracks of India','/blog/post/33'),(34,'Happy Journey','Autocar India','http://i.haymarketindia.net/Features/yamaha.jpg','Seeks a 150cc motorcycle that will deliver good fuel efficiency, decent performance and be reliable.','/blog/post/34'),(35,'New Suzuki Lets scooter first look review','Autocar India','http://i.haymarketindia.net/ExtraImages/20140218053849_let10.jpg','Will Suzuki Let\'s prove to be a worthy contender in the highly competitive 110cc scooter segment?','/blog/post/35'),(36,'Mercedes GLC SUV to launch on June 2, 2016','Autocar India','http://i.haymarketindia.net/ExtraImages/20160520025506_glc.jpg','The GLC will plug the gap between the GLA and GLE; will use the familiar 2.1-litre diesel engine.','/blog/post/36'),(37,'Ferrari 488 GTB review, test drive','Autocar India','http://i.haymarketindia.net/ExtraImages/20150807015731_1LOR5079.jpg','Ferrari forays into turbocharged territory with a smaller, twin-turbo V8 in the new 488 GTB. Hormazd Sorabjee gets in the driverâ€™s seat.','/blog/post/37'),(38,'New Honda Activa i review, test ride','Autocar India','http://i.haymarketindia.net/ExtraImages/20130723074041__DSC5480.JPG','We ride Hondaâ€™s sleek looking and lighter Activa-i scooter.','/blog/post/38'),(39,'Top 10 fuel-efficient petrol cars in India','Autocar India','http://i.haymarketindia.net/ExtraImages/20160517095808_0_468_700_http---172.17.115.180-82-ExtraImages-20120524054226_Petrol- filling- shot.jpg','If petrol is your fuel of choice and fuel efficiency a priority, then these are the cars for you.','/blog/post/39'),(40,'Adrenaline junkie','Autocar India','http://i.haymarketindia.net/Features/KTM 200 Duke.JPG','Wants to know if the KTM 200 Duke suffers from engine overheating issues on long 